import React from 'react';
import s from './MyPosts.module.css'
import Post from './Post/Post';

const MyPosts = (props) => {
let addButton = () => ( alert('Что ты хочешь?? не нада жать55') );
    return (
        <div>
            <div>
            <textarea></textarea>
                <div><button onClick={ addButton }>Создать новый пост </button></div>
            </div>
            {props.posts.map((el)=> {return <Post post={el.post} id={el.id}/>})}
        </div>
    );
};

export default MyPosts;
